SELECT CAST(EXTRACT(YEAR FROM "Motos_2"."FECHA") AS SIGNED) AS "yr:FECHA:ok" FROM "Motos_2" WHERE ((CAST(EXTRACT(YEAR FROM "Motos_2"."FECHA") AS SIGNED) >= 2010) AND (CAST(EXTRACT(YEAR FROM "Motos_2"."FECHA") AS SIGNED) <= 2015) AND ("Motos_2"."Categoria" IN ('CAMIONES', 'CAMIONES, BUSES Y PANELES', 'MOTOCICLETAS', 'PICK UPS, VANS Y JEEPS', 'PICK-UPS', 'SUV Y JEEPS', 'VEHICULOS NUEVOS'))) GROUP BY "yr:FECHA:ok";
